import React from "react";

// Stateless component to display names
const MainList = ({ names }) => {
  return (
    <ul>
      {names.map((nameItem) => (
        <li key={nameItem.id}>{nameItem.name}</li>
      ))}
    </ul>
  );
};

export default MainList;
